// src/pages/Algorithm2.js
import React from 'react';
import CodeEditor from '../../components/CodeEditor';


const Algorithm2 = () => {
  const codeSnippet = `// Code specific for Algorithm 2
function expand() {
  // Implementation details for Algorithm 2
}`;

  return (
    <div style={{ padding: '1rem' }}>
      <h1>Algorithm 2</h1>
      
      <section>
        <h2>Overview</h2>
        <p>
        This project focuses on implementing and analyzing a degeneracy-based variation of the Bron-Kerbosch algorithm for maximal clique enumeration in sparse graphs. The paper by Eppstein, Löffler, and Strash introduces a novel approach that leverages graph degeneracy to improve performance in real-world networks, many of which are naturally sparse. By optimizing the recursive search strategy and reducing unnecessary computations, the algorithm achieves a worst-case time complexity of O(dn3d/3), which is nearly optimal for sparse graphs.
        </p>
      </section>
      
      <section>
        <h2>Implementation Details</h2>
        <ul>
          <li><strong>Graph Representation:</strong> Store the input as an adjacency list.</li>
          <li><strong>Enhanced DFS:</strong> Compute an ordering of vertices based on degeneracy.</li>
          <li><strong>Modified Bron-Kerbosch Algorithm:</strong> <></><li>Iterate over vertices in degeneracy order.</li>
          <li>Use the pivoting strategy to reduce recursive calls.</li>
          <li>Generate and report maximal cliques efficiently.</li></li>
        </ul>
        <h3>Code</h3>
        <CodeEditor code={codeSnippet} />
      </section>
      
      <section>
        <h2>Expectation</h2>
        <ul>
          <li>Demonstrate the heuristic’s impact on reducing overall computation time.</li>
          <li>Show performance improvements on denser graphs.</li>
        </ul>
      </section>
      
      <section>
        <h2>Observation</h2>
        <p>
          Early benchmarks suggest that the heuristic reduces processing time significantly for larger graphs.
        </p>
      </section>
    </div>
  );
};

export default Algorithm2;
